function App() {
  return (
    <>
    <Header />
    <dl className="dictionary">
    {emojipedia.map(x => (
    <Entry 
    key = {x.id}
    emoji = {x.emoji}
    name = {x.name}
    meaning = {x.meaning}
    />
  )) }
    </dl>
    </>
  );
}

export default App;
